If the string ends in px, the `Height` of the watermark will be in pixels. For example, `100px` means that `Height` is 100 pixels. Value range: 0 or [8, 4096]. Default value: 0px, which means that `Height` will be proportionally scaled according to the aspect ratio of the original watermark image.

